import './App.css';
import Home from "./pages/Home"
import {BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';

// 
function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Routes>
          <Route path="/" exact element={Home} />
        </Routes>

      </Router>

    </div>
  );
}

export default App;
